import React from "react";
import { NavLink } from "react-router-dom";


function Navigation() {
  return (
    <div className="title-bar">
      <div class="logo">
        <a href="/" className="gradient-text">
          wait.
        </a>
      </div>
    </div>
  );
}

export default Navigation;
